My enrollment time was some days ago and when I tried to enroll in 16B, I received, &#34;Error: Request not processed. There is no wait list available. The wait list request was not processed, as there are no wait list places available for one or more of the class sections in this request.&#34;

Does anyone know what to do? 

Both of my Lab discussion sections are open(green), it is still not letting me register.

First I get this error &#34;Error: You are unable to enroll in this class at this time. Available seats are reserved and you do not meet the reserve capacity requirements. If a wait list is available, you may still be placed on the waitlist for this class. To do this, select Add Another Class to return to step 1. Select the class link, select the wait list option and resubmit your request. Note that waitlisted units will count toward the total units limit during each enrollment phase. Waitlisted units do not count toward financial aid eligibility.&#34;

After selecting the option &#34;Wait list if class is full. I get this error:

&#34;Error: Request not processed. There is no wait list available. The wait list request was not processed, as there are no wait list places available for one or more of the class sections in this request.&#34;

Please let me know what to do next. Thanks
